;; @@
(ns fanova.chapter02.lpksmoother
  (:require [gorilla-plot.core :as plot]
            [gorilla-repl.table :as table]
            [clojure.core.matrix :as m]
            [incanter.core :as i]
            [clojure.java.io :as io]
	        [clojure.core.matrix.stats :as s]
            [fda.utils :as utils]
            [fda.smoothing.lpk :as lpk]))

(m/set-current-implementation :vectorz)

;;(m/set-current-implementation :aparapi-matrix)
;;(ac/set-execution-mode :CPU) ; :CPU, :GPU, etc.

(import 'com.jmatio.io.MatFileReader)
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-class'>com.jmatio.io.MatFileReader</span>","value":"com.jmatio.io.MatFileReader"}
;; <=

;; **
;;; Load progesterone data
;; **

;; @@
(def brfits (MatFileReader. (io/file (io/resource "brfits.mat"))))
(def nonconceptive (i/dataset [:subj, :x, :y, :missing] (.getArray (.getMLArray brfits "data1"))))
(def conceptive (i/dataset [:subj, :x, :y, :missing] (.getArray (.getMLArray brfits "data2"))))
(print (i/head nonconceptive))
