;; **
;;; Figure 3.1 Plot of GCV score against bandwidth h (in log10-scale ) for reconstructing the progesterone data by the LPK reconstruction method with degree = 1.
;; **

;; @@
(def plotter (fn [data] (plot/list-plot data 
                                        :joined true
	                                    :plot-range [:all [-4 4]] 
     	                               	:color "#000000" 
         	                           	:plot-size 350
               	                       	:opacity 0.2)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;fanova.chapter02.lpksmoother/plotter</span>","value":"#'fanova.chapter02.lpksmoother/plotter"}
;; <=

;; **
;;; The best bandwidth is selected based on all dataset.
;; **

;; @@
(time (def all-bandwidth (:best (lpk/select-bandwidth (concat nonconceptive-obs conceptive-obs) :degree 1))))
all-bandwidth
;; @@
;; ->
;;; &quot;Elapsed time: 218.013 msecs&quot;
;;; 
;; <-
;; =>
;;; {"type":"html","content":"<span class='clj-double'>1.4041165440976882</span>","value":"1.4041165440976882"}
;; <=

;; @@
(def non-fits (map #(lpk/fit % :bandwidth all-bandwidth :degree 1) nonconceptive-obs))
(def non-points (map #(map vector (:x (meta %)) (:y-estimate (meta %))) non-fits))
(def non-plots (map plotter non-points))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;fanova.chapter02.lpksmoother/non-plots</span>","value":"#'fanova.chapter02.lpksmoother/non-plots"}
;; <=

;; @@
(def con-fits (map #(lpk/fit % :bandwidth all-bandwidth :degree 1) conceptive-obs))
(def con-points (map #(map vector (:x (meta %)) (:y-estimate (meta %))) con-fits))
(def con-plots (map plotter con-points))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;fanova.chapter02.lpksmoother/con-plots</span>","value":"#'fanova.chapter02.lpksmoother/con-plots"}
;; <=

;; @@
(table/table-view [[(apply plot/compose non-plots) (apply plot/compose con-plots)]] 
                  :columns ["nonconseptive" "conceptive"])
